import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

const Link = props => {
    var text;
    if(props.text) {
        text = props.text;
    } else {
        text = props.url;
    }
    const style = "width: 18px; height: 20px;";
    return (
        <div className="col gy-4">
        <div className="card text-dark bg-warning mb-3" style={{style}}>
            <div className="card-header">{props.project}</div>
            <div className="card-body">
                <a className="card-text" href={props.url}>{text}</a>
            </div>
        </div>
        </div>
    )
}

export default Link;
